import React, { Component } from 'react'

class Form extends Component {
    constructor(props) {
      super(props)
    
      this.state = {
         username : ''
      }
    }

    handleUsernameChange = (event) => {
        this.setState = ({
            username : event.target
        })
    }

    render() {
        return (
          <form>
            <div>
                <label>Username</label>
                <input type='text'value={this.state.username} onChange={handleUsernameChange}/>
            </div>
          </form>
        )
    }
}

export default Form
